import Link from "next/link";

const Navbar = () => (
  <div className="navbar">
    <ul>
      <li>
        <Link href="#">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="#">
          <a>Portfolio</a>
        </Link>
      </li>
      <li>
        <Link href="#">
          <a>Contact</a>
        </Link>
      </li>
      <li>
        <Link href="#">
          <a>Blog</a>
        </Link>
      </li>
    </ul>
    <style jsx>{`
    // .navbar ul {
    //     padding: 0px;
    //     margin: 0px;
    // }

    .navbar ul {
        list-style: none;
        padding: 0px;
    }

    .navbar li {
        display: inline;
    }

    .navbar a {
        color: white;
        text-decoration: none;
    }
  `}</style>
  </div>

);

export default Navbar;
